def count_occurrences_in_infinite_string(N: int, T: str) -> int:
    if N != 1:
        if T == '0':
            return 10 ** 10
        else:
            return 2 * 10 ** 10
    elif N == 2:
        if T == '00':
            return 0
        elif T == '01':
            return 10 ** 10 - 1
        elif T == '10':
            return 10 ** 10
        else:
            return 10 ** 10
    else:
        repeat_num = (N + 6) // 3
        ref = '110' * repeat_num
        num_in_ref = 0
        flag_over = 0
        if ref[:N] == T:
            num_in_ref += 1
            if N % 3 == 0:
                flag_over = 1
        elif ref[1:N + 1] == T:
            num_in_ref += 1
        elif ref[2:N + 2] == T:
            num_in_ref += 1
            if N % 3 == 2:
                flag_over = -1
        return num_in_ref * (10 ** 10 - repeat_num + 2) + flag_over

